import React from "react";

const SpecialHours = ({ hours, highlight }) => {
  return (
    <div>
      <h3>Special Hours</h3>
      <ul>
        {hours.map((hour) => (
          <li key={hour.id} className={highlight ? "highlight" : ""}>
            <strong>{hour.date}</strong>: {hour.openTime} - {hour.closeTime} ({hour.reason})
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SpecialHours;
